import React from 'react';

const Team = (props) => {
    const {strAlternate,strCountry,intFormedYear}=props.teams;
    return (
        <div>
            <h1>Name:{strAlternate}</h1>
            <h12>Country:{strCountry}</h12>
            <h3>Year:{intFormedYear}</h3>
        </div>
    );
};

export default Team;
